const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`The `}<a parentName="p" {...{
        "href": "https://discord.gg/redis"
      }}>{`Redis Discord server`}</a>{` is a place where you can learn, share, and collaborate about anything and everything Redis.`}</p>
    <ul>
      <li parentName="ul">{`Connect with users from the community, Redis University, and Redis Labs.`}</li>
      <li parentName="ul">{`Get your questions answered and learn cool new tips and tricks.`}</li>
      <li parentName="ul">{`Watch for notifications of new content from Redis and the community.`}</li>
      <li parentName="ul">{`Share your knowledge and expertise with others.`}</li>
    </ul>
    <h2 {...{
      "id": "how-to-join"
    }}>{`How to join`}</h2>
    <p>{`If you already have a Discord account, joining is easy. Just go to `}<a parentName="p" {...{
        "href": "https://discord.gg/redis"
      }}>{`https://discord.gg/redis`}</a>{` and your in.`}</p>
    <p>{`If you don't have a Discord account, you'll need to `}<a parentName="p" {...{
        "href": "https://discord.com/register"
      }}>{`create one`}</a>{`. Once you have an account, you can `}<a parentName="p" {...{
        "href": "https://discord.com/"
      }}>{`download Discord`}</a>{` for you desktop, get the mobile app, or just use it in a browser.`}</p>
    <h2 {...{
      "id": "server-rules"
    }}>{`Server rules`}</h2>
    <p>{`One you are on the server, you should be aware of our rules:`}</p>
    <ul>
      <li parentName="ul">{`Be respectful.`}</li>
      <li parentName="ul">{`Sending and linking harmful material will result in an immediate and permanent ban.`}</li>
      <li parentName="ul">{`No shady links (e.g. to .jar files, or .exe files).`}</li>
      <li parentName="ul"><strong parentName="li">{`DO NOT`}</strong>{` spam. Also, `}<strong parentName="li">{`DO NOT`}</strong>{` spam.`}</li>
      <li parentName="ul"><strong parentName="li">{`DO NOT`}</strong>{` use vulgar or explicit language‚Äîkeep it family friendly.`}</li>
      <li parentName="ul"><strong parentName="li">{`DO NOT`}</strong>{` claim authorship of assets that are not yours. Plagiarism will result in a ban.`}</li>
      <li parentName="ul"><strong parentName="li">{`DO`}</strong>{` share your projects and ideas, but `}<strong parentName="li">{`DO NOT`}</strong>{` advertise or solicit in the chat.`}</li>
      <li parentName="ul"><strong parentName="li">{`DO NOT`}</strong>{` ping @here or @everyone and `}<strong parentName="li">{`DO NOT`}</strong>{` spam your messages to multiple channels.`}</li>
      <li parentName="ul"><strong parentName="li">{`DO NOT`}</strong>{` DM the admins or send us friend requests unless we invite you to do so.`}</li>
      <li parentName="ul">{`Abide by the `}<strong parentName="li"><a parentName="strong" {...{
            "href": "https://redislabs.com/community/community-guidelines-code-of-conduct/"
          }}>{`Redis Community Guidelines & Code of Conduct`}</a></strong>{`.`}</li>
    </ul>
    <h2 {...{
      "id": "how-to-get-help"
    }}>{`How to get help`}</h2>
    <p>{`Got a question you want answered? Got a problem you can‚Äôt figure out? Don‚Äôt worry. Happens to the best of us. We have a help system inspired by the one used by the most excellent `}<a parentName="p" {...{
        "href": "https://pythondiscord.com/"
      }}>{`Python Discord`}</a>{`.`}</p>
    <h3 {...{
      "id": "tldr"
    }}>{`tl;dr`}</h3>
    <p>{`Ask a question in a channel in ‚ùì `}<strong parentName="p">{`Help: Available`}</strong>{`. That channel moves to ‚úã `}<strong parentName="p">{`Help: In Use`}</strong>{`. Converse, discuss, get an answer. Close the channel with `}<inlineCode parentName="p">{`/close`}</inlineCode>{` when you‚Äôre done and it moves to üí§ `}<strong parentName="p">{`Help: Dormant`}</strong>{`.`}</p>
    <h3 {...{
      "id": "full-version"
    }}>{`Full Version`}</h3>
    <p>{`So, we built a help system to make it easier to ask and answer. There are a series of help channels on the server that all start with `}<inlineCode parentName="p">{`help-`}</inlineCode>{` followed by a letter in the NATO Phonetic Alphabet (you know, the whole `}<em parentName="p">{`alfa bravo charlie`}</em>{` thing). There are 26 channels grouped into `}<strong parentName="p">{`Help: Available`}</strong>{`, `}<strong parentName="p">{`Help: In Use`}</strong>{`, and `}<strong parentName="p">{`Help: Dormant`}</strong>{`.`}</p>
    <p>{`‚ùì `}<strong parentName="p">{`Help: Available`}</strong>{` contains channels that are available for a question. If you have a question, you can claim this channel simply by posting it there. The channel will immediately be moved to `}<em parentName="p">{`Help: In Use`}</em>{`.`}</p>
    <p>{`‚úã `}<strong parentName="p">{`Help: In Use`}</strong>{` has channels that are being used to answer a question. If you have the answer to a fellow user‚Äôs question, post it here. If you asked the question, other users may answer it. If someone has answered your question‚Äîor perhaps you answer it yourself‚Äîyou can close the channel by typing `}<inlineCode parentName="p">{`/close`}</inlineCode>{`. Channels will automatically close if they are inactive for 48 hours. Closed channels are moved to `}<em parentName="p">{`Help: Dormant`}</em>{`.`}</p>
    <p>{`üí§  `}<strong parentName="p">{`Help: Dormant`}</strong>{` is for channels that are not currently in use. You can read them‚Äîuseful as there are lots of answered questions here‚Äîbut you cannot post to them. When someone claims a channel in `}<em parentName="p">{`Help: Available`}</em>{`, a random channel is selected from `}<em parentName="p">{`Help: Dormant`}</em>{` to replace it.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
